import STATUS from "./../STATUS";

export default function dryWetChanged(prev, current) {
  prev = prev.effector;
  current = current.effector;
  let response = null;
  
  if(!current.lastChange.sygnature ||
     current.lastChange.sygnature && !current.lastChange.sygnature.startWith("#DryWetChange")){
        return null
  }

  for (let channelName of Object.keys(prev.channels)) {
    const prevValue = prev.channels[channelName].dryWet;
    const currentValue = current.channels[channelName].dryWet;
    if (prevValue !== currentValue) {
      response = response || [];
      response.push({
        status: STATUS.DRY_WET_CHANGED,
        channel: channelName,
        prevValue: prevValue,
        currentValue: currentValue
      });
    }
  }
  return response;
}
